[{"location":"#COVID-19-Geovisualisation-Documentation","page":"COVID-19 Geovisualisation Documentation","title":"COVID-19 Geovisualisation Documentation","text":"","category":"section"},{"location":"#Introduction","page":"COVID-19 Geovisualisation Documentation","title":"Introduction","text":"","category":"section"},{"location":"","page":"COVID-19 Geovisualisation Documentation","title":"COVID-19 Geovisualisation Documentation","text":"This web application is an interactive geographical visualiser based on COVID-19 data provided by the Center for Systems Science and Engineering (CSSE) at Johns Hopkins University.","category":"page"},{"location":"","page":"COVID-19 Geovisualisation Documentation","title":"COVID-19 Geovisualisation Documentation","text":"The global view GUI consists of two sections, general information on the left and an interactive geographical visualisation scatter plot on the right. The information cards provide up to date information from the COVID-19 dataset. This information can be changed/updated using the controls in the navigation bar. Each information card has an additional tooltip. A tooltip provides additional information on the attribute. Also on the left hand-side is the top six table. The interactive geographical visualisation scatter plot provides an interactive visual aspect to the project. It displays data using a scatter plot graph. Only one attribute is displayed at any one time. The attributes can be changed using the tabs above the scatter map plot. The options are confirmed cases, death cases and case fatality rate. This also updates the data on table. The slider under the scatter map plot allows the user to select a date to view on the map plot. This ranges from the beginning of the COVID-19 pandemic to current day. A description on how to use the slider is located beside it.","category":"page"},{"location":"","page":"COVID-19 Geovisualisation Documentation","title":"COVID-19 Geovisualisation Documentation","text":"The country view GUI consists of two sections, information cards and statistics on the left and interactive line graphs on the right. The information cards provides up to date information from the COVID-19 dataset. This information can be changed/updated using the controls in the navigation bar. Each information card has an additional tooltip also. The statistics table provides additional detailed information on the selected county, such as highest confirmed cases in a single day or even the mean confirmed cases. On the second section of the country view, it is split into four graphs. The first row consists of a map plot of the selected country and a line graph of vaccinations administered. The second row is made up of line graphs for confirmed cases and deaths. All of the graphs/plots are interactive and use the selected countries data from the datasets. ","category":"page"},{"location":"#Table-of-Contents","page":"COVID-19 Geovisualisation Documentation","title":"Table of Contents","text":"","category":"section"},{"location":"","page":"COVID-19 Geovisualisation Documentation","title":"COVID-19 Geovisualisation Documentation","text":"","category":"page"},{"location":"#Geovisualisation.jl","page":"COVID-19 Geovisualisation Documentation","title":"Geovisualisation.jl","text":"","category":"section"},{"location":"","page":"COVID-19 Geovisualisation Documentation","title":"COVID-19 Geovisualisation Documentation","text":"Geovisualisation.jl contain the Dash web application, including the layout and callbacks.","category":"page"},{"location":"","page":"COVID-19 Geovisualisation Documentation","title":"COVID-19 Geovisualisation Documentation","text":"runGeovisualiser()","category":"page"},{"location":"#Geovisualisation.runGeovisualiser-Tuple{}","page":"COVID-19 Geovisualisation Documentation","title":"Geovisualisation.runGeovisualiser","text":"runGeovisualiser()\n\n\n\n\n\n","category":"method"},{"location":"#utils.jl","page":"COVID-19 Geovisualisation Documentation","title":"utils.jl","text":"","category":"section"},{"location":"","page":"COVID-19 Geovisualisation Documentation","title":"COVID-19 Geovisualisation Documentation","text":"readGlobalConfirmedCSV()","category":"page"},{"location":"#Geovisualisation.readGlobalConfirmedCSV-Tuple{}","page":"COVID-19 Geovisualisation Documentation","title":"Geovisualisation.readGlobalConfirmedCSV","text":"readGlobalConfirmedCSV()\n\nReads time series COVID-19 global confirmed cases raw CSV file from repository.\n\nReturns dataframe of global confirmed cases.\n\n\n\n\n\n","category":"method"},{"location":"","page":"COVID-19 Geovisualisation Documentation","title":"COVID-19 Geovisualisation Documentation","text":"readGlobalDeathsCSV()","category":"page"},{"location":"#Geovisualisation.readGlobalDeathsCSV-Tuple{}","page":"COVID-19 Geovisualisation Documentation","title":"Geovisualisation.readGlobalDeathsCSV","text":"readGlobalDeathsCSV()\n\nReads time series COVID-19 global deaths raw CSV file from repository.\n\nReturns dataframe of global death cases.\n\n\n\n\n\n","category":"method"},{"location":"","page":"COVID-19 Geovisualisation Documentation","title":"COVID-19 Geovisualisation Documentation","text":"readGlobalRecoveredCSV()","category":"page"},{"location":"#Geovisualisation.readGlobalRecoveredCSV-Tuple{}","page":"COVID-19 Geovisualisation Documentation","title":"Geovisualisation.readGlobalRecoveredCSV","text":"readGlobalRecoveredCSV\n\nReads time series COVID-19 global recovered cases raw CSV file from repository.\n\nReturns dataframe of global recovered cases.\n\n\n\n\n\n","category":"method"},{"location":"","page":"COVID-19 Geovisualisation Documentation","title":"COVID-19 Geovisualisation Documentation","text":"readGlobalVaccinationCSV()","category":"page"},{"location":"#Geovisualisation.readGlobalVaccinationCSV-Tuple{}","page":"COVID-19 Geovisualisation Documentation","title":"Geovisualisation.readGlobalVaccinationCSV","text":"readGlobalVaccinationCSV\n\nReads time series COVID-19 global recovered cases raw CSV file from repository.\n\nReturns dataframe of global vaccination cases.\n\n\n\n\n\n","category":"method"},{"location":"","page":"COVID-19 Geovisualisation Documentation","title":"COVID-19 Geovisualisation Documentation","text":"getTotalConfirmedCases(df, country, date)","category":"page"},{"location":"#Geovisualisation.getTotalConfirmedCases-Tuple{Any, Any, Any}","page":"COVID-19 Geovisualisation Documentation","title":"Geovisualisation.getTotalConfirmedCases","text":"getTotalConfirmedCases\n\nGets total confirmed cases worldwide by summing all countries in dataframe up to specified date. \n\nReturns number of total confirmed cases of country at a specific date.\n\n\n\n\n\n","category":"method"},{"location":"","page":"COVID-19 Geovisualisation Documentation","title":"COVID-19 Geovisualisation Documentation","text":"getTotalRecoveredCases(df, country, date)","category":"page"},{"location":"#Geovisualisation.getTotalRecoveredCases-Tuple{Any, Any, Any}","page":"COVID-19 Geovisualisation Documentation","title":"Geovisualisation.getTotalRecoveredCases","text":"getTotalRecoveredCases\n\nGets total recovered cases worldwide by summing all countries in dataframe up to specified date. \n\nReturns number of total recovered cases of country at a specific date.\n\n\n\n\n\n","category":"method"},{"location":"","page":"COVID-19 Geovisualisation Documentation","title":"COVID-19 Geovisualisation Documentation","text":"getTotalDeaths(df, country, date)","category":"page"},{"location":"#Geovisualisation.getTotalDeaths-Tuple{Any, Any, Any}","page":"COVID-19 Geovisualisation Documentation","title":"Geovisualisation.getTotalDeaths","text":"getTotalDeathsCases\n\nGets total deaths cases worldwide by summing all countries in dataframe up to specified date. \n\nReturns number of total deaths cases of country at a specific date.\n\n\n\n\n\n","category":"method"},{"location":"","page":"COVID-19 Geovisualisation Documentation","title":"COVID-19 Geovisualisation Documentation","text":"getTotalVaccinations(df, country, date)","category":"page"},{"location":"#Geovisualisation.getTotalVaccinations-Tuple{Any, Any, Any}","page":"COVID-19 Geovisualisation Documentation","title":"Geovisualisation.getTotalVaccinations","text":"getTotalVaccinations\n\nGets total vaccinations worldwide by summing all countries in dataframe.\n\nReturns number of total vaccinations in a country at a specific date.\n\n\n\n\n\n","category":"method"},{"location":"","page":"COVID-19 Geovisualisation Documentation","title":"COVID-19 Geovisualisation Documentation","text":"getTotalCaseFatality(df, country, date)","category":"page"},{"location":"#Geovisualisation.getTotalCaseFatality-Tuple{Any, Any, Any}","page":"COVID-19 Geovisualisation Documentation","title":"Geovisualisation.getTotalCaseFatality","text":"getTotalCaseFatality\n\nGets total case fatality rate worldwide.\n\nReturns case fatality rate in a country at a specific date.\n\n\n\n\n\n","category":"method"},{"location":"","page":"COVID-19 Geovisualisation Documentation","title":"COVID-19 Geovisualisation Documentation","text":"getTopSixFromDataframe(df)","category":"page"},{"location":"#Geovisualisation.getTopSixFromDataframe-Tuple{Any}","page":"COVID-19 Geovisualisation Documentation","title":"Geovisualisation.getTopSixFromDataframe","text":"getTopSixFromDataframe\n\nGets top six countries for selected attribute worldwide.\n\nReturns country and value for table.\n\n\n\n\n\n","category":"method"},{"location":"","page":"COVID-19 Geovisualisation Documentation","title":"COVID-19 Geovisualisation Documentation","text":"getStatisticsTableForCountry(filteredConfirmedData, filteredDeathsData, filteredVaccinationData)","category":"page"},{"location":"#Geovisualisation.getStatisticsTableForCountry-Tuple{Any, Any, Any}","page":"COVID-19 Geovisualisation Documentation","title":"Geovisualisation.getStatisticsTableForCountry","text":"getStatisticsTableForCountry\n\nGets statistics for table for specified country. Dataframes are already filtered.\n\nReturns statistics with values for table in country view\n\n\n\n\n\n","category":"method"},{"location":"","page":"COVID-19 Geovisualisation Documentation","title":"COVID-19 Geovisualisation Documentation","text":"getCaseFatalityDataframe(confirmedData, deathsData)","category":"page"},{"location":"#Geovisualisation.getCaseFatalityDataframe-Tuple{Any, Any}","page":"COVID-19 Geovisualisation Documentation","title":"Geovisualisation.getCaseFatalityDataframe","text":"getCaseFatalityDataframe\n\nGets case fatality rate dataframe from confirmed and death dataframes.\n\nReturns case fatality rate dataframe.\n\n\n\n\n\n","category":"method"},{"location":"","page":"COVID-19 Geovisualisation Documentation","title":"COVID-19 Geovisualisation Documentation","text":"getListOfCountries(df)","category":"page"},{"location":"#Geovisualisation.getListOfCountries-Tuple{Any}","page":"COVID-19 Geovisualisation Documentation","title":"Geovisualisation.getListOfCountries","text":"getListOfCountries\n\nGets list of all countries listed in dataframe. If country has multiple entries, the province/state is added also.\n\nReturns array of countries for dropdown.\n\n\n\n\n\n","category":"method"},{"location":"","page":"COVID-19 Geovisualisation Documentation","title":"COVID-19 Geovisualisation Documentation","text":"getStartDate(df)","category":"page"},{"location":"#Geovisualisation.getStartDate-Tuple{Any}","page":"COVID-19 Geovisualisation Documentation","title":"Geovisualisation.getStartDate","text":"getStartDate\n\nProvides start date for date picker.\n\nReturns date object of start date.\n\n\n\n\n\n","category":"method"},{"location":"","page":"COVID-19 Geovisualisation Documentation","title":"COVID-19 Geovisualisation Documentation","text":"getEndDate(df)","category":"page"},{"location":"#Geovisualisation.getEndDate-Tuple{Any}","page":"COVID-19 Geovisualisation Documentation","title":"Geovisualisation.getEndDate","text":"getEndDate\n\nProvides end date for date picker.\n\nReturns date object of end date.\n\n\n\n\n\n","category":"method"},{"location":"","page":"COVID-19 Geovisualisation Documentation","title":"COVID-19 Geovisualisation Documentation","text":"formatToDateObject(date)","category":"page"},{"location":"#Geovisualisation.formatToDateObject-Tuple{Any}","page":"COVID-19 Geovisualisation Documentation","title":"Geovisualisation.formatToDateObject","text":"formatToDateObject\n\nConverts date format provided in the dataframe to a date object.\n\nReturns date object of date string.\n\n\n\n\n\n","category":"method"},{"location":"","page":"COVID-19 Geovisualisation Documentation","title":"COVID-19 Geovisualisation Documentation","text":"convertTimeSeriesData(data)","category":"page"},{"location":"#Geovisualisation.convertTimeSeriesData-Tuple{Any}","page":"COVID-19 Geovisualisation Documentation","title":"Geovisualisation.convertTimeSeriesData","text":"convertTimeSeriesData\n\nConverts array of integer timeseries data into regular values.\n\nReturns array of values.\n\n\n\n\n\n","category":"method"},{"location":"","page":"COVID-19 Geovisualisation Documentation","title":"COVID-19 Geovisualisation Documentation","text":"prettifyNumberArray(data)","category":"page"},{"location":"#Geovisualisation.prettifyNumberArray-Tuple{Any}","page":"COVID-19 Geovisualisation Documentation","title":"Geovisualisation.prettifyNumberArray","text":"prettifyNumberArray\n\nThis function prettifies a number array to include comma separated values.\n\nReturns array of prettified numbers.\n\n\n\n\n\n","category":"method"},{"location":"","page":"COVID-19 Geovisualisation Documentation","title":"COVID-19 Geovisualisation Documentation","text":"roundNumberArray(data)\n\n## Index\n","category":"page"},{"location":"#Geovisualisation.roundNumberArray-Tuple{Any}","page":"COVID-19 Geovisualisation Documentation","title":"Geovisualisation.roundNumberArray","text":"prettifyNumberArray\n\nThis function rounds a number array to 3 decimal places.\n\nReturns array of round numbers.\n\n\n\n\n\n","category":"method"},{"location":"","page":"COVID-19 Geovisualisation Documentation","title":"COVID-19 Geovisualisation Documentation","text":"@index ```","category":"page"}]
